const raw = $json.raw;

// Detecta onde est a lista de participantes
let participants = [];
if (Array.isArray(raw)) {
  const holder = raw.find(o => o && o.data && Array.isArray(o.data.participants));
  participants = holder?.data?.participants ?? [];
} else {
  participants = raw?.data?.participants ?? [];
}

// Gera um item por participante
return participants.map(p => {
  const whatsapp = String(p?.jid || '').replace('@s.whatsapp.net', '');
  return {
    json: {
      whatsapp,
      lid: p?.lid ?? null
    }
  };
});
